import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import Offcanvas from 'react-bootstrap/Offcanvas';
import Button from 'react-bootstrap/Button';
import FormControl from 'react-bootstrap/FormControl';
import 'bootstrap/dist/css/bootstrap.min.css';

class Header extends React.Component {
  render(){
    //SETTINGS
    const expand = 'header';
    const search = 'Поиск';
    const link = 'Ссылка';
    // const logo = "./content/main/cherry.svg";
    //
    return(
      <Navbar key={expand} variant="dark" bg="dark" expand={expand} className="mb-3">
      <Container fluid>
        <Navbar.Brand href="#"><img className="img-fluid" src={this.props.logo} height="35" width="35"/>{this.props.market_name}</Navbar.Brand>
        <Button variant="warning" className="offset-md-8">{search}</Button>
        <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
        <Navbar.Offcanvas
          id={`offcanvasNavbar-expand-${expand}`}
          aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
          placement="end"
          backdrop="false"
        >
          <Offcanvas.Header closeButton>
            <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
              Меню
            </Offcanvas.Title>
          </Offcanvas.Header>
          <Offcanvas.Body>
            <Nav className="justify-content-end flex-grow-1 pe-3">
            <Form className="d-flex">
              <FormControl
                type="search"
                placeholder={search}
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">{search}</Button>
            </Form>
              <Nav.Link href="#action1">{link}</Nav.Link>
              <Nav.Link href="#action2">{link}</Nav.Link>
              <NavDropdown
                title="Подменю"
                id={`offcanvasNavbarDropdown-expand-${expand}`}
              >
                <NavDropdown.Item href="#action3">{link}</NavDropdown.Item>
                <NavDropdown.Item href="#action4">
                  {link}
                </NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action5">
                  {link}
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Offcanvas.Body>
        </Navbar.Offcanvas>
      </Container>
    </Navbar>
    );
  }
}

export default Header;
